import axios from 'axios'

const TRAFFIC_BASE_REST_API_URL = 'http://localhost:8080/controlsystem/v2'

class DriverService{
    getAllDrivers(){
        return axios.get(TRAFFIC_BASE_REST_API_URL)
    }

    createDriver(driver){
        return axios.post(TRAFFIC_BASE_REST_API_URL, driver)
    }
}

export default new DriverService();
